import React from 'react';
import StyleChange from '../../../Functions/ChangeStyles';
import * as actions from '../../../Redux/Actions/actions';
import { connect } from 'react-redux';

class MediaFileTypes extends React.PureComponent {
  render() {
    var data = this.props.pagedTablesData;
    return (
      <div>
        <p style={{ color: 'wheat' }}>Mediafiles type </p>
        <button
          with="150px"
          className="recordsPerPage"
          id="profile"
          onClick={(e) => {
            this.props.getOrders(
              this.props.activeMenu,
              e.target.id,
              1,
              'profile',
            );
            StyleChange(e.target.id, 'recordsPerPage'); //!!!!!!!!!!!!!
          }}
        >
          Profile photo
        </button>
        <button
          className="recordsPerPage"
          id="employeeGallery"
          onClick={(e) => {
            this.props.getOrders(
              this.props.activeMenu,
              e.target.id,
              1,
              'employeeGalery',
            );
            StyleChange(e.target.id, 'recordsPerPage');
          }}
        >
          Employee gallery
        </button>
      </div>
    );
  }
}

function mapStateToProps(state) {
  return {
    pagedTablesData: state.pagedTablesData,
    activeMenu: state.activeMenu,
  };
}

function mapDispatchToProps(dispatch) {
  return {
    getOrders: (menu, rowsPerPage, pageNumber, type) =>
      dispatch(
        actions.FeetchMainTableData(menu, rowsPerPage, pageNumber, type),
      ),
  };
}

export default connect(mapStateToProps, mapDispatchToProps)(MediaFileTypes);
